jQuery(document).ready(function(){jQuery("#bkap_delete").on("click",function(){if(1==confirm(edit_post_param.confirm_msg)){var data={booking_id:edit_post_param.post_id,action:"bkap_delete_booking"};jQuery.post(edit_post_param.ajax_url,data,function(response){window.location.replace(edit_post_param.order_url)})}}),jQuery(".bkap_cancel").on("click",function(){window.location.replace(edit_post_param.order_url)}),jQuery("#bkap_add_zoom_meeting").on("click",function(){var data={booking_id:edit_post_param.post_id,meeting_link:jQuery("#bkap_manual_zoom_meeting").val(),action:"bkap_add_zoom_meeting"};jQuery.post(edit_post_param.ajax_url,data,function(response){jQuery("#bkap_add_zoom_meeting").html(response.meeting_link),jQuery("#bkap_manual_zoom_meeting").hide(),jQuery("#bkap_manual_zoom_meeting_info").hide()})})});
